function obtenerParametrosURL() {
    const urlParams = new URLSearchParams(window.location.search);
    return {
        busqueda: urlParams.get('q'),
        categoria: urlParams.get('categoria'),
        marcaId: urlParams.get('marcaId'), // Viene del botón "Todas las Sucursales"
        ciudad: urlParams.get('ciudad')
    };
}

/**
 * Extrae el prefijo de la marca (Ej: 'D001' de 'D001-S01').
 */
function obtenerIdMarca(idSucursal) {
    if (idSucursal && idSucursal.includes('-')) {
        return idSucursal.split('-')[0];
    }
    return idSucursal;
}

/**
 * Analiza el nombre/dirección para deducir la Ciudad/Zona principal.
 */
function extraerCiudadZona(agencia) {
    const nombre = agencia.nombre.toUpperCase();
    const direccion = agencia.direccion.toUpperCase();

    if (nombre.includes('(COROICO)') || direccion.includes('COROICO')) {
        return 'Coroico';
    }
    if (nombre.includes('ZONA SUR') || nombre.includes('CALACOTO') || nombre.includes('ACHUMANI')) {
        return 'Zona Sur LPZ';
    }
    if (nombre.includes('(LPZ)') || nombre.includes('LA PAZ') || nombre.includes('(POTOSÍ)') || nombre.includes('MIRAFIORES') || nombre.includes('SOPOCACHI')) {
        return 'LPZ (La Paz)';
    }
    if (nombre.includes('(EL ALTO)') || nombre.includes('EL ALTO') || nombre.includes('SENKATA') || nombre.includes('VILLA ADELA') || nombre.includes('CIELO MALL')) {
        return 'EL ALTO';
    }
    // Asume LPZ por defecto si no hay etiquetas claras, o use una etiqueta 'Otros'
    return 'LPZ (La Paz)';
}

/**
 * Rellena dinámicamente los dropdowns de Marca y Ciudad/Zona
 */
function poblarFiltros() {
    const marcasUnicas = new Map();
    const ciudadesUnicas = new Set();

    datosAgencias.forEach(agencia => {
        // 1. Marcas (Usamos Map para asegurar IDs únicos)
        const idBase = obtenerIdMarca(agencia.id);
        if (!marcasUnicas.has(idBase)) {
            // Extracción del nombre de la marca (se puede refinar más si es necesario)
            let nombreMarca = agencia.nombre.split('.')[0].trim();
            marcasUnicas.set(idBase, nombreMarca);
        }

        // 2. Ciudad/Zona
        const ciudad = extraerCiudadZona(agencia);
        if (ciudad) {
            ciudadesUnicas.add(ciudad);
        }
    });

    // 3. Rellenar Select de Marcas
    const selectMarcas = document.getElementById('filtro-marcas');
    selectMarcas.innerHTML = '<option value="">Marca</option>';
    marcasUnicas.forEach((nombre, idBase) => {
        const option = document.createElement('option');
        option.value = idBase;
        option.textContent = nombre;
        selectMarcas.appendChild(option);
    });

    // 4. Rellenar Select de Ciudad/Zona
    const selectCiudades = document.getElementById('filtro-Ciudad/Zona');
    selectCiudades.innerHTML = '<option value="">Ciudad/Zona</option>';
    ciudadesUnicas.forEach(ciudad => {
        const option = document.createElement('option');
        option.value = ciudad;
        option.textContent = ciudad;
        selectCiudades.appendChild(option);
    });
}

