function configurarEscuchadoresDeFiltro() {
    const inputBusqueda = document.getElementById('filtro-busqueda');
    const selectCategoria = document.getElementById('filtro-categoria');
    const selectCiudad = document.getElementById('filtro-Ciudad/Zona');
    const selectMarca = document.getElementById('filtro-marcas');
    // ✅ NUEVO:
    const selectWhatsapp = document.getElementById('filtro-whatsapp');

    // ... (manejadorFiltro se mantiene igual) ...
    const manejadorFiltro = () => {
        const filtrosActuales = leerFiltrosUI();

        // Si el usuario usa un select (marca, ciudad, categoría o WhatsApp), 
        // limpiamos la búsqueda de texto para priorizar el select.
        if (filtrosActuales.marcaId || filtrosActuales.ciudad || filtrosActuales.categoria || filtrosActuales.tieneWhatsapp) {
            filtrosActuales.busqueda = '';
            if (inputBusqueda) inputBusqueda.value = ''; // Limpiar visualmente
        }

        filtrarYMostrarAgencias(filtrosActuales);
    };


    // Asignar listeners (con verificación de existencia de elementos)
    if (selectCategoria) selectCategoria.addEventListener('change', manejadorFiltro);
    if (selectCiudad) selectCiudad.addEventListener('change', manejadorFiltro);
    if (selectMarca) selectMarca.addEventListener('change', manejadorFiltro);
    // ✅ NUEVO LISTENER:
    if (selectWhatsapp) selectWhatsapp.addEventListener('change', manejadorFiltro);

    if (inputBusqueda) inputBusqueda.addEventListener('keyup', manejadorFiltro);
}


// --- FUNCIÓN PRINCIPAL DE GOOGLE MAPS (window.initMap) ---
window.initMap = async function () {

    // 1. INICIALIZAR ESTRUCTURA DE FILTROS HTML
    poblarFiltros();

    // 2. INICIALIZAR MAPA (Solo se hace una vez)
    if (document.getElementById('mapa-global')) {
        const centroDefecto = { lat: -16.535, lng: -68.18 };
        mapaGlobal = new google.maps.Map(document.getElementById('mapa-global'), {
            zoom: 13,
            center: centroDefecto,
        });
    }

    // 3. APLICAR FILTROS INICIALES (Si la URL tiene parámetros)
    const parametrosURL = obtenerParametrosURL();
    filtrarYMostrarAgencias(parametrosURL);

    // 4. CONFIGURAR ESCUCHADORES DE EVENTOS
    configurarEscuchadoresDeFiltro();
};

// ... (El resto de sus funciones como 'abrirModal', 'colocarMarcadoresGlobales', 'renderizarAgencias', etc.) ...

function obtenerParametrosURL() {
    const urlParams = new URLSearchParams(window.location.search);
    return {
        busqueda: urlParams.get('q'),
        categoria: urlParams.get('categoria'),
        // NUEVOS/AJUSTADOS
        marcaId: urlParams.get('marcaId') || urlParams.get('marca'), // Acepta 'marcaId' del modal o 'marca' del filtro
        ciudad: urlParams.get('ciudad')
    };
}
let mapaModal = null;
let marcadorModal = null;
let iconoBase = null;
let iconoDestacado = null;

/**
* Aplica los filtros a los datos y actualiza el mapa/lista.
* @param {object} filtrosActivos Objeto que contiene los criterios de filtrado.
*/
function filtrarYMostrarAgencias(filtrosActivos) {
    // Asegúrese de que 'datosAgencias' exista
    if (!Array.isArray(datosAgencias)) return;

    let agenciasFiltradas = datosAgencias;

    // --- FILTROS PRINCIPALES (Marca o Búsqueda) ---

    // 1. FILTRO POR ID DE MARCA (Prioridad máxima)
    if (filtrosActivos.marcaId) {
        const idBase = filtrosActivos.marcaId.toUpperCase();
        agenciasFiltradas = agenciasFiltradas.filter(agencia => agencia.id.startsWith(idBase));
    }
    // 2. FILTRO POR BÚSQUEDA DE TEXTO (Solo si NO se seleccionó un filtro de marca)
    else if (filtrosActivos.busqueda) {
        const termino = filtrosActivos.busqueda.toLowerCase();
        agenciasFiltradas = agenciasFiltradas.filter(agencia =>
            agencia.nombre.toLowerCase().includes(termino) ||
            agencia.categoria.toLowerCase().includes(termino)
        );
    }

    // --- FILTROS COMPLEMENTARIOS ---

    // 3. FILTRO POR CATEGORÍA
    if (filtrosActivos.categoria) {
        agenciasFiltradas = agenciasFiltradas.filter(agencia => agencia.categoria === filtrosActivos.categoria);
    }

    // 4. FILTRO POR CIUDAD/ZONA
    if (filtrosActivos.ciudad) {
        agenciasFiltradas = agenciasFiltradas.filter(agencia => extraerCiudadZona(agencia) === filtrosActivos.ciudad);
    }

    if (filtrosActivos.tieneWhatsapp === 'si') {
        // Normalizamos los valores que indican ausencia de WhatsApp (N/A, NO TIENE, vacío)
        agenciasFiltradas = agenciasFiltradas.filter(agencia => {
            const whatsappValue = String(agencia.whatsapp || '').toUpperCase().trim();

            // Retorna TRUE si el valor existe Y NO ES una cadena de ausencia conocida.
            return whatsappValue !== '' &&
                whatsappValue !== 'NO TIENE' &&
                whatsappValue !== 'N/A';
        });
    }

    // 6. ACTUALIZAR MAPA Y LISTA
    if (typeof colocarMarcadoresGlobales === 'function') {
        colocarMarcadoresGlobales(agenciasFiltradas);
    }
    if (typeof renderizarAgencias === 'function') {
        renderizarAgencias(agenciasFiltradas);
    }
}

function renderizarTarjetasPorCategoria(agencias) {

    if (agencias.length === 0) {
        contenedorCategorias.innerHTML = '<p class="sin-resultados">No se encontraron agencias que coincidan con su búsqueda o categoría.</p>';
        return;
    }
    const agenciasAgrupadas = agruparPorCategoria(agencias);
    let htmlFinal = '';

    for (const categoria in agenciasAgrupadas) {
        // ... (El resto del código dentro de esta función se mantiene igual)
        htmlFinal += `
            <section class="seccion-categoria">
                <h2 class="titulo-categoria">${categoria}</h2>
                <div class="lista-tarjetas" data-categoria="${categoria}">
        `;

        agenciasAgrupadas[categoria].forEach(agencia => {
            htmlFinal += crearTarjetaHTML(agencia);
        });

        htmlFinal += `
                </div>
            </section>
        `;
    }

    contenedorCategorias.innerHTML = htmlFinal;
    agregarListenersTarjeta();
}

// --- 3. FUNCIONES DE MAPA ---

function colocarMarcadoresGlobales(agencias) {
    // 1. Limpia los marcadores antiguos si existieran
    Object.values(marcadores).forEach(m => m.setMap(null));

    // 2. Limpia el objeto de referencias para solo tener los marcadores actuales
    // Esto es crucial para que `destacarMarcador` funcione solo con los visibles.
    for (const key in marcadores) {
        delete marcadores[key];
    }

    // Ahora solo creamos marcadores para las agencias que pasaron el filtro
    agencias.forEach(agencia => {
        const posicion = new google.maps.LatLng(agencia.coordenadas.lat, agencia.coordenadas.lng);

        const marcador = new google.maps.Marker({
            position: posicion,
            map: mapaGlobal, // Se añade al mapa global
            title: agencia.nombre,
            icon: iconoBase,
            zIndex: 1
        });

        // Almacenar el marcador en el objeto global 'marcadores' para referencia
        marcadores[agencia.id] = marcador;

        // Evento para abrir el modal al hacer clic en el marcador
        marcador.addListener('click', () => {
            abrirModal(agencia.id);
        });
    });
}
/**
* Destaca un marcador específico en el mapa global y la tarjeta asociada.
* @param {string|number} agenciaId El ID único de la agencia a destacar.
*/
function destacarMarcador(agenciaId) {
    // 1. Restaurar el marcador previamente destacado
    if (marcadorDestacado) {
        marcadorDestacado.setIcon(iconoBase);
        marcadorDestacado.setZIndex(1);
    }
    // Quitar la clase 'destacada' de TODAS las tarjetas.
    document.querySelectorAll('.tarjeta-distribuidora').forEach(t => {
        t.classList.remove('destacada');
    });


    const nuevoMarcador = marcadores[agenciaId];
    if (nuevoMarcador) {
        // A. Aplicar estilo de destacado al marcador
        nuevoMarcador.setIcon(iconoDestacado);
        nuevoMarcador.setZIndex(10); // Lo trae al frente del mapa

        // B. Centrar el mapa global en el marcador
        // Solo centrar si el mapa existe
        if (mapaGlobal) {
            mapaGlobal.setCenter(nuevoMarcador.getPosition());
        }

        // C. Almacenar la referencia del marcador destacado
        marcadorDestacado = nuevoMarcador;
        // Opcional: puede ser útil para saber qué tarjeta está destacada
        // nuevoMarcador.agenciaId = agenciaId; 

        // D. Aplicar estilo de destacado a la tarjeta HTML
        const tarjetaActiva = document.querySelector(`.tarjeta-distribuidora[data-id="${agenciaId}"]`);
        if (tarjetaActiva) {
            tarjetaActiva.classList.add('destacada');
            // Opcional: Desplazar la tarjeta a la vista si está fuera de pantalla
            tarjetaActiva.scrollIntoView({ behavior: 'smooth', block: 'nearest' });
        }
    } else {
        // Si el marcador no existe (por ejemplo, si está fuera del filtro actual),
        // simplemente borramos la referencia destacada para evitar errores.
        marcadorDestacado = null;
    }
}


// --- 4. RENDERIZADO DE TARJETAS Y MANEJO DE EVENTOS ---

function renderizarAgencias(agencias) {
    const contenedorTarjetas = document.getElementById('contenedor-tarjetas');
    const contadorResultados = document.getElementById('contador-resultados');
    contenedorTarjetas.innerHTML = '';

    agencias.forEach(agencia => {
        const tarjeta = document.createElement('article');
        tarjeta.classList.add('tarjeta-distribuidora');
        tarjeta.setAttribute('data-id', agencia.id);

        tarjeta.innerHTML = `
<img src="${agencia.logo}" alt="logo de ${agencia.nombre}" class="logo-empresa">
 <div class="detalles-empresa">
 <h3>${agencia.nombre}</h3>
 <p>${agencia.categoria}</p>
 <p>Dirección: ${agencia.direccion}</p>
<p>WhatsApp: ${agencia.whatsapp === "NO TIENE" ? 'NO TIENE' : agencia.whatsapp}</P>
     </div> `;

        // EVENTO DE CLIC: Muestra el modal
        tarjeta.addEventListener('click', () => {
            abrirModal(agencia.id);
        });

        // EVENTO MOUSEOVER: Destaca el marcador en el mapa
        tarjeta.addEventListener('mouseover', () => {
            destacarMarcador(agencia.id);
        });

        contenedorTarjetas.appendChild(tarjeta);
    });

    contadorResultados.textContent = agencias.length;
}


// 5. Lógica del Modal (CORREGIDA para incluir el mapa del modal)

window.abrirModal = function (agenciaId) {
    const agencia = datosAgencias.find(a => a.id === agenciaId);
    if (!agencia) return;

    // 1. Destacar el marcador global y la tarjeta
    destacarMarcador(agenciaId);

    // 2. Llenar datos del modal
    document.getElementById('modal-logo').src = agencia.logo;
    document.getElementById('modal-nombre').textContent = agencia.nombre;
    document.getElementById('modal-categoria').textContent = `Categoría: ${agencia.categoria}`;
    document.getElementById('modal-id').textContent = agencia.id;
    document.getElementById('modal-direccion').textContent = agencia.direccion;

    const whatsappLink = document.getElementById('modal-whatsapp');
    if (agencia.whatsapp && agencia.whatsapp !== "NO TIENE") {
        const numeroLimpio = agencia.whatsapp.replace(/[^0-9+]/g, '');
        whatsappLink.href = `https://wa.me/${numeroLimpio}`;
        whatsappLink.style.display = 'inline-block';
    } else {
        whatsappLink.style.display = 'none';
    }

    // 3. Mostrar el modal (IMPORTANTE: Debe ser visible antes de manipular el mapa del modal)
    const modalElement = document.getElementById('modal-agencia-detalle');
    modalElement.classList.add('visible');


    // --- 4. LÓGICA DEL MAPA DENTRO DEL MODAL ---

    // La API de Maps a veces necesita un pequeño retraso para asegurar que el DIV esté completamente visible.
    setTimeout(() => {
        const centro = { lat: agencia.coordenadas.lat, lng: agencia.coordenadas.lng };
        const divMapaModal = document.getElementById('mapa-modal');

        if (mapaModal === null) {
            // Inicializar el mapa del modal la primera vez
            mapaModal = new google.maps.Map(divMapaModal, {
                zoom: 15,
                center: centro,
                streetViewControl: false,
                mapTypeControl: false
            });

            // Crear el marcador
            marcadorModal = new google.maps.Marker({
                position: centro,
                map: mapaModal,
                title: agencia.nombre,
                icon: iconoDestacado,
            });
        } else {
            // Si el mapa ya existe, reajusta su centro y mueve el marcador
            mapaModal.setCenter(centro);
            marcadorModal.setPosition(centro);

            // Disparar el evento de redimensionamiento (CLAVE si el contenedor estaba oculto)
            google.maps.event.trigger(mapaModal, 'resize');
        }
    }, 100); // Pequeño retraso de 100ms
}

// Lógica para cerrar el modal
function cerrarModal() {
    document.getElementById('modal-agencia-detalle').classList.remove('visible');
}

// Ejecutar la lógica de listeners cuando el DOM esté cargado
document.addEventListener('DOMContentLoaded', () => {
    const modal = document.getElementById('modal-agencia-detalle');
    const botonCerrar = modal.querySelector('.modal-cerrar');

    // Listeners para cerrar el modal
    botonCerrar.addEventListener('click', cerrarModal);

    window.addEventListener('click', (event) => {
        if (event.target === modal) {
            cerrarModal();
        }
    });
});
function colocarMarcadoresGlobales(agencias) {
    // Limpia los marcadores antiguos si existieran (útil para filtros futuros)
    Object.values(marcadores).forEach(m => m.setMap(null)); // Oculta todos los marcadores existentes

    // Ahora solo creamos marcadores para las agencias que pasaron el filtro
    agencias.forEach(agencia => {
        const posicion = new google.maps.LatLng(agencia.coordenadas.lat, agencia.coordenadas.lng);

        const marcador = new google.maps.Marker({
            position: posicion,
            map: mapaGlobal,
            title: agencia.nombre,
            icon: iconoBase,
            zIndex: 1
        });

        // Almacenar el marcador en el objeto global 'marcadores' para referencia
        marcadores[agencia.id] = marcador;

        // Evento para abrir el modal al hacer clic en el marcador
        marcador.addListener('click', () => {
            abrirModal(agencia.id);
        });
    });
}